int get_index(string end_tag){
  char tmp[end_tag.size() + 1];
  string new_end_tag;
  size_t pos;

  // Fill tmp with zeros to avoid segfaults
  memset(tmp, '\0', end_tag.size() + 1);

  for (int i=names.size()-1; i >= 0; i--) {
    if (get_tagName(end_tag) == get_tagName(names[i]))
      return i;
  }

  return -1;
}

